import React, { Component } from 'react'
import SidePage from '@skbkontur/react-ui/SidePage'
import Button from '@skbkontur/react-ui/Button'
import Typography from '@material-ui/core/Typography'
import './SidePage.css'

interface Props{
    closeSidePage() : void
}

interface State{

}

class AddWork extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }



    private renderSidePage() {
        return (
            <SidePage onClose={this.props.closeSidePage} blockBackground>
            <div className='sideTitle'><SidePage.Header>Предложить тему курсовой работы</SidePage.Header></div>
            <SidePage.Body>
                <SidePage.Container>
                  <div className='themeTitle'><Typography variant='h5'>Название темы</Typography></div>
                </SidePage.Container>

            </SidePage.Body>
            <SidePage.Footer panel>
              <Button onClick={this.props.closeSidePage}>Close</Button>
            </SidePage.Footer>
          </SidePage>
        );

      }


    render(){
        return this.renderSidePage();
    }
}

export default AddWork
